import React from 'react';
import {NavLink} from 'react-router-dom';




function Navbar(){
  return (
    <div>
      <nav>
      <div class="logo"><img src="./logo2.png"  alt="logo" /></div>
        <div class="links">
          <NavLink class='btn-hover'  to='/' exact activeClassName="active">Strona Główna</NavLink>
          <NavLink class='btn-hover'  to='/onas' activeClassName="active">O nas</NavLink>
          <NavLink class='btn-hover'  to='/oferta' activeClassName="active">Oferta</NavLink>
          <NavLink class='btn-hover' to='/przedszkole' activeClassName="active">Przedszkole</NavLink>
          <NavLink class='btn-hover'  to='/aktualnosci' activeClassName="active">Aktualności</NavLink>
          <NavLink  class='btn-hover' to='/rekrutacja' activeClassName="active">Rekrutacja</NavLink>
          <NavLink class='btn-hover' to='/kontakt' activeClassName="active">Kontakt</NavLink>
          
  
        </div>
        <div class="links-mobile"></div>
      </nav>
    </div>
  );
};
  
export default Navbar;
